INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1548', 'There is a stamp in the cache for stamping your personal logbook, and the cache’s logbook will be stamped with your personal stamp. Take care not to mix up stamps and to leave the cache’s stamp in the cache! Frequently letterboxes can be found without GPS, maybe with a compass and paces from a location - add the \"without GPS\" attribute for those.', '2010-09-12 22:52:28');
