INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1537', 'DE', 'Dein HTML-Code wird nochmals durch einen speziellen Filter verändert. Dies ist notwendig um gefährliche HTML-Tages wie z.B. \&lt;script\&gt; zu filtern. Eine Liste mit erlaubten HTML-Tags findest du <a href=\"http://www.opencaching.de/articles.php?page=htmltags\">hier</a>.', '2010-09-11 02:56:58');
