INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('2092', 'DE', 'Du hast bereits mehr als %1 identische Logs eingetragen. Bitte überprüfe, ob du das Datum deiner Cachesuchen eingibst, nicht das heutige Datum \&ndash; auch beim \&bdquo;Nachloggen\&ldquo; alter Funde.', '2013-04-25 23:00:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('2093', 'DE', 'Ein falsches Logdatum kann verschiedene Funktionen der OC-Software beeinträchtigen, wie z.\&nbsp;B. die Suchsortierung nach letzten Logdatum. Außerdem kann der Eindruck entstehen, der Cache sei kürzlich gefunden worden (Datum und Art des letzten Logs erscheinen in der Cacheübersicht des Owners!), was die Cachewartung beeinträchtigt und zu mehr DNF führen kann.', '2013-04-25 23:00:00');
