INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1544', 'ES', 'Zona Peligrosa', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1545', 'ES', 'Esta cache se puede encontrar solamente por la noche - tienes que considerar <i>cache notturna</i>. Puede haber placas reflectantes que brillaran y te llevaran al cache, o otros mecanismo especiales para caches nocturnos.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1546', 'ES', 'Este geocachee esta publicado sólo en Opencaching. Este atributo permite a los usuarios de otras plataformas  encontrar rápidamente caches interesantes de calidad OC geocaching.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1548', 'ES', 'Hay un sello en el cache para estamparlo en su libro de registro personal, y el libro de registro del cache será sellada con su sello personal. ¡Tenga cuidado de no mezclar los sellos! Con frecuencia los letterboxes se pueden encontrar sin GPS, tal vez con una brújula y unos pasos de una ubicación - Añadir el atributo - sin gps, para este clase de caches.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1549', 'ES', 'El cache está situado en una zona peligrosa. Utilice este atributo para señalar los peligros evidentes, tales como carreteras con mucho tráfico, terreno empinado o caída de rocas. Usted debe tomar medidas de seguridad o evitar ir a buscar el caché, sobre todo con niños, con grupos grandes o en condiciones meteorológicas adversas.', '2010-12-09 00:18:00');
