INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1596', 'ES', 'Otro tipo de cache', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1597', 'ES', 'Pregunte a los propietarios por las condiciones iniciales', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1598', 'ES', 'Apto para niños', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1599', 'ES', '¡Hay ferrocarriles activos en las proximidades. Por favor, tenga cuidado, manteniendo una distancia segura y cruzar los rieles sólo en los cruces de ferrocarril, etc.!', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1600', 'ES', 'Hay acantilados o rocas peligrososas en las cercanas. Tenga cuidado cuando esté bajo las piedras caídas, y tenga cuidado cuando esté sobre el acantilado - especialmente con los niños y el ciclismo. Puede ser muy peligroso tomar un camino empinado para subir el acantilado porque no se puede saber de antemano cuando el primero termina y comienza otra.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1601', 'ES', 'El geocache se coloca dentro de un coto de caza. Al caer la tarde y en la oscuridad, una linterna o faro siempre debe utilizarse por razones de seguridad.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1602', 'ES', 'Hay espinas cerca de la caché. Use ropa apropiada.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1603', 'ES', 'Cada temporada hay un montón de garrapatas en este lubar. Y es recomendable llevar pantalón largo y examinarse en busca de garrapatas después de encontrar el cache.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1604', 'ES', 'En el agua', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1605', 'ES', 'Esta cache se puede encontrar tanto de día como de noche.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1606', 'ES', 'Esta cache se puede hacer solamente en ciertos momentos del día - véase la descripción de caché para obtener más detalles. Por ejemplo, la cache puede ser colocado en un área con horarios restringidos.', '2013-02-21 00:32:43');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1607', 'ES', 'Deberas encontrar este cache sólo durante el día. Por ejemplo, el área puede ser peligroso y contienen rocas o abismos. O bien, el uso de linternas puede ser imposible porque sería sospechoso en una zona residencial.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1609', 'ES', 'Esta cache se encuentrar durante todo el año, mientras que la dificultad puede depender de las estaciones. Especificar las dificultades para <i>buone</i> condiciones.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1610', 'ES', '¡No intente esta cache durante la temporada de cría de los animales! Por favor, indique en la descripción del cache de la época del año debe ser evitado. Preste atención también a las condiciones o signos en cuanto al respeto por la naturaleza.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1611', 'ES', 'Este cache también se puede encontrar después de fuertes nevadas. Todas las fases y geocaches se esconde en lugares seguros para la caída de la nieve, no será cubierto por acumulaciones de nieve.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1612', 'ES', 'Necesitarás un equipo especial no especificado por otros atributos, tales como un puntero láser, walkie-talkie, gato de coche.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1613', 'ES', 'Se necesita una brújula.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1614', 'ES', 'Es necesario una linterna para encontrar este cache. ¡No se olvide de las baterías de repuesto!', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1615', 'ES', 'Para este cache, tendrá que utilizar los equipos y saber cómo utilizarlo correctamente. Si usted es un principiante, no lo haga solos, sino que utiliza el apoyo de un experimentado escalador o alpinista.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1616', 'ES', 'Este geocache está escondido en una cueva, y se debe utilizar el equipo adecuado para acceder a ella. Tenga en cuenta que incluso las pequeñas cuevas pueden prever los problemas imprevistos y peligros, como durante las tormentas o con un esguince de tobillo. ¡Acceda con personas experimentadas en cuevas! También debe protegerse la naturaleza sobre todo en esos lugares donde los murciélagos no deben  ser molestados.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1617', 'ES', 'Necesitará un equipo de buceo para encontrar este geocache. La profundidad del agua en la ubicación de la cache se especifica en la descripción. Tenga en cuenta que el buceo requiere un entrenamiento especial. Sin experiencia de buceo, puedes buscar por el caché, junto con un buceador experimentado.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1618', 'ES', 'Este cache por lo general sólo se puede encontrar con una moto de agua. Nadando es imposible debido a la distancia o la corriente. Véase la descripción del cache para obtener más detalles.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1619', 'ES', 'Necesitas encontrar más información antes de poder buscar este cache. Esto se aplica comúnmente a los cachés de puzzle o misterio.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1620', 'ES', 'Misterio o Puzzle para ser resuelto antes o durante la búsqueda de este cache.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1621', 'ES', 'Antes o durante la búsqueda de este cache, resolver problemas matemáticos sencillos más difícil a los cálculos de la base.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1622', 'ES', 'Este es un cache que no pertenece a ninguna de las categorías predefinicas - estándar. Utilice este atributo para caches especial e inusuales.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1623', 'ES', 'Antes de intentar este cache, debe informarse con el propietario de las condiciones iniciales. Por ejemplo, la caché puede estar relacionado con algunos eventos en fechas diferentes.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1624', 'ES', 'Este geocache se creó para los niños. Todas las tareas se puede completar por los niños entre los años 10 y 12 y el terrno no está exenta de riesgo (tales como carreteras, acantilados). Hay un gran contenedor con intercambio final y las tareas son interesantes.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1625', 'ES', 'Esta cache le llevará a un área de la mina (abandonado). Puede haber peligro con el colapso de túneles o galerías que puede ser necesario para cruzar. Tenga cuidado y use de equipo adecuado, especialmente en la oscuridad. Las minas antiguas pueden ser objeto de preservación histórica.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1626', 'ES', 'Hay plantas venenosas en las cercanías. Tenga cuidado y asegúrese de que los niños o los perros no las toquen ni tragarlas.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1627', 'ES', 'Esta zona es frecuentada por los animales potencialmente peligrosos, por ejemplo. zorros rabiosos, serpientes venenosas, escorpiones, osos.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1628', 'ES', 'Una zona de aparcamiento se encuentra cerca del punto de partida de este cache. Si no hay aparcamiento gratuito, agregue el atributo \"de entrada o tarifa de estacionamiento\".', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1629', 'ES', 'Este cache se encuentra también fuera de las zonas urbanas y una estación de transporte público. No utilizar este atributo para geocaches en las zonas urbanas que siempre tienen transporte público.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1630', 'ES', 'Hay agua potable a lo largo de la ruta o cerca de la cache. Este atributo es especialmente útil en la planificación de Eventos, o caches con viajes largos a lugares como las cuevas  o minas probablemente esté sucio.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1631', 'ES', 'Hay baños públicos a lo largo de la carretera o en las proximidades del cache. Este atributo es especialmente útil para la planificación caches lejanos, multicaches o Eventos.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1632', 'ES', 'Hay teléfonos públicos en la carretera o en las proximidades del cache.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1633', 'ES', 'Hay un punto de socorro, un teléfono para pedir ayuda, un centro de rescate de montaña o similar cerca del cache. Este atributo es especialmente útil en zonas difíciles, como en la escalada de cache, caches en cuevas en las montañas o el agua. Verifique si usted puede agregar un número de teléfono de emergencia (rescate en montaña, por ejemplo).', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1634', 'ES', 'El geocache se encuentra cerca de un parking, a poca distancia.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1635', 'ES', 'Esta cache requiere una larga caminata - más de 5 kilometros de ida y vuelta. En las montañas escarpadas o en otras áreas. Recomendados calzado para caminar y equipo adecuado.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1636', 'ES', 'Esta cache requiere la superación de pantanos. Usar ropa apropiada. Después de la lluvia, el suelo puede ser difícil o no factible.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1637', 'ES', 'Una o más pendientes para acceder al cache.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1638', 'ES', 'Esta cache requiere un poco de escalada y puede ser necesario usar las manos, pero no es necesario material de montaña. ¡Tenga mucho cuidado durante la temporada de lluvias.!', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1639', 'ES', 'Esta cache requiere cruzar un río o un lago. El agua es lo suficientemente profundo para nadar. Puede utilizar un barco, pero la distancia es lo suficientemente corto como para ser asequible para un nadador.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1640', 'ES', 'Hay un monumento cerca del cache, como un paisaje hermoso o un castillo en ruinas. Este lugar es digno de visitar, incluso sin un geocache cerca.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1641', 'ES', 'Este geocache está en movimiento. Por ejemplo, el propietario podía mover la caché periódicamente de un lugar a otro, o un geobuscador podría hacer esto y ofrecer nuevos detalles en su registro. El propietario debe actualizar las coordenadas en la descripción del cache después de cada movimiento.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1642', 'ES', 'Hay una webcam en el lugar de destino. necesidad a alguien para registrar con un pantallazo de la imagen de la webcam de su visita e incluirlo en el registro. Puede haber requisitos adicionales como un signo de geocaching en la imagen. La dirección de la webcam está incluido en la descripción de la cache, y debe ser accesible al público, que no debería exigir un registro en el sitio o similares.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1643', 'ES', 'Este geocache no está al aire libre, esta oculto dentro de un edificio, una cueva o similares.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1644', 'ES', 'Esta cache o una de sus etapas se encuentran bajo el agua. Usted debe entrar en el agua, nadar o zambullirse.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1645', 'ES', 'Esta cache se puede encuentra sin un dispositivo GPS. Detalles adicionales no se utilizan, además de las coordenadas iniciales.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1646', 'ES', 'Deberas pagar un acceso o estacionamiento para acceder a esta cache, por ejemplo, si la cache está situado en un parque temático. Si no hay aparcamiento gratuito alternativa cercana, por favor incluya en la descripción. Por favor, tenga en cuenta nuestras condiciones de uso sobre geocaches comerciales.', '2010-12-09 00:18:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1647', 'ES', 'No puedrá encontrar este cache en un solo día o durante la noche. Usted tendrá que visitar el lugar más de una vez, o necesitará pasar la noche. El tiempo de preparación no está incluido en este cálculo, sólo el tiempo en el sitio.', '2010-12-09 00:18:00');
