INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1705', 'ES', '<br /><i>Obsoleto: El atributo no puede concederse a una nuevo cache, porque no está de acuerdo con las condiciones actuales de uso.</i><br /> Este caché está disponible no sólo en Opencaching, sino también en otros sitios de geocaching. Esto se aplica al cache que se han relacionado por sus propietarios a los anuncios correspondientes en otros sitios. Tenga en cuenta que las descripciones y el estado de un cache que figuran en más de un sitio deberá de ser igual en todos los sitios incluidos Opencaching, de acuerdo con nuestros términos de uso.', '2010-12-09 00:18:01');
