INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('81', 'FR', 'Qu\'est-ce que je peux trouver sur ce site\&nbsp;?', '2015-08-25 01:28:59');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('82', 'FR', 'Sur cette page vous trouverez des Geocaches de tout le monde, en mettant l\'accent sur l\'Allemagne, l\'Autriche, la Suisse, l\'Italie et l\'Espagne. Nous offrons également des informations sur les sujets de geocaching divers, et un forum (message board) et le chat pour communiquer avec d\'autres géocacheurs.</p><p class="startmessage">Si vous souhaitez propager geocaching dans votre propre pays, vous pouvez lancer votre propre site Opencaching dans votre propre langue, en utilisant notre <a href="https://github.com/OpencachingDeutschland/oc-server3" target="_blank">software</a> et savoir-faire.', '2015-08-25 01:28:59');
