INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('2070', 'FR', 'Une ou plusieurs e-mails à cet utilisateur ne pouvaient pas être livrés. Il pourrait être une bonne idée de connecter plus de commentaires sur les geocaches de l\'utilisateur, et / ou d\'utiliser des adresses de contact de rechange comme un compte message de conseil ou d\'une autre plate-forme de geocaching.', '2015-08-25 01:29:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('2071', 'FR', 'Cette cache a été \"temporairement indisponible\" pendant plus d\'un an maintenant\&nbsp;; par conséquent, il est archivée automatiquement. Le propriétaire peut décider de maintenir le cache et réactiver la liste.', '2015-08-25 01:29:00');
