INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1533', 'IT', 'Per cache virtuali e webcam, la dimensione del contenitore deve essere -nessun contenitore-!', '2010-09-13 22:10:04');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1537', 'IT', 'Il tuo codice HTML verrà modificato di nuovo da uno speciale filtro. Questo è necessario per evitare tag HTML pericolosi, come ad esempio\&lt;script\&gt;. Una lista dei tag HTML permessi la puoi trovare <a href=\"http://www.opencaching.de/articles.php?page=htmltags\">qui</a>.', '2010-09-13 22:10:04');
