INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1542', 'IT', 'Solo collegamento ad un altro portale di caching', '2010-09-12 22:54:55');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1543', 'IT', 'Letterbox (richiede un timbro)', '2010-09-12 22:55:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1544', 'IT', 'Area pericolosa', '2010-09-12 22:55:05');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1545', 'IT', 'Questa cache può essere trovata solo di notte - è una cosiddetta <i>cache notturna</i>. Ci possono essere targhette riflettenti che devono essere illuminate e ti conducono al nascondiglio, o altri speciali meccanismi di caching notturno.', '2010-09-12 22:54:46');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1546', 'IT', 'Questa geocache è pubblicata solo su Opencaching. Questo attributo permette agli utenti di altre piattaforme di geocaching di trovare velocemente interessanti cache OC di qualità.', '2010-09-12 22:54:41');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1548', 'IT', 'C\'è un timbro nella cache per timbrare il tuo quaderno personale, e il log della cache verrà timbrato con il tuo timbro personale. Fate attenzione a non confondere i timbri e a lasciare il timbro della cache nella cache! Spesso le letterbox possono essere trovate senza GPS, magari con una bussola e contando i passi - in questo caso aggiungici l\'attributo \"senza GPS\".', '2010-09-13 15:08:37');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1549', 'IT', 'La cache è situata in un\'area pericolosa. Usa questo attributo per segnalare pericoli non ovvi, come strade ad alto traffico, terreno ripido o caduta sassi. Si dovrebbero adottare misure di sicurezza o evitare di andare a cercare la cache, in particolare nel geocaching con bambini, con gruppi numerosi o in condizioni climatiche sfavorevoli.', '2010-10-27 18:49:19');
