INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1705', 'IT', '<br /><i>Obsoleto: Questo attributo non può essere assegnato a nuove cache, perché non è conforme nelle attuali condizioni d\'uso.</i><br /> Questa cache è disponibile non solo su Opencaching, ma anche in altri siti di geocaching. Questo vale per le cache che sono state collegate dai loro proprietari a corrispondenti annunci in altri siti. Si prega di notare che le descrizioni e lo stato di una cache elencata in più di un sito devono essere mantenute uguali in tutti i siti compreso Opencaching, secondo le nostre condizioni d\'uso. ', '2010-10-27 18:49:20');
